import React from 'react';

const Dashboard = ({ stats, loading }) => {
  if (loading) {
    return (
      <div className="dashboard">
        <div className="loading">Loading dashboard data...</div>
      </div>
    );
  }

  // Add safety check for stats
  if (!stats) {
    return (
      <div className="dashboard">
        <div className="error">No data available</div>
      </div>
    );
  }

  return (
    <div className="dashboard">
      <div className="dashboard-header">
        <h1>Dashboard Overview</h1>
        <p>Welcome to your admin panel</p>
      </div>

      <div className="stats-grid">
        <div className="stat-card">
          <div className="stat-icon">üìù</div>
          <div className="stat-content">
            <h3>{stats.totals?.blogs || 0}</h3>
            <p>Total Blog Posts</p>
            <small>{stats.totals?.publishedBlogs || 0} published</small>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">üíº</div>
          <div className="stat-content">
            <h3>{stats.totals?.projects || 0}</h3>
            <p>Projects</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">‚úâÔ∏è</div>
          <div className="stat-content">
            <h3>{stats.totals?.messages || 0}</h3>
            <p>Messages</p>
          </div>
        </div>
      </div>

      <div className="dashboard-sections">
        <div className="section recent-blogs">
          <h3>Recent Blog Posts</h3>
          {stats.recent?.blogs && stats.recent.blogs.length > 0 ? (
            <div className="recent-list">
              {stats.recent.blogs.map(blog => (
                <div key={blog._id} className="recent-item">
                  <span className="item-title">{blog.title}</span>
                  <span className={`item-status status-${blog.status}`}>
                    {blog.status}
                  </span>
                </div>
              ))}
            </div>
          ) : (
            <p>No blog posts yet</p>
          )}
        </div>

        <div className="section recent-messages">
          <h3>Recent Messages</h3>
          {stats.recent?.messages && stats.recent.messages.length > 0 ? (
            <div className="recent-list">
              {stats.recent.messages.map(message => (
                <div key={message._id} className="recent-item">
                  <span className="item-title">{message.name || 'Anonymous'}</span>
                  <span className="item-preview">
                    {message.message?.substring(0, 50)}...
                  </span>
                </div>
              ))}
            </div>
          ) : (
            <p>No messages yet</p>
          )}
        </div>

        <div className="section recent-projects">
          <h3>Recent Projects</h3>
          {stats.recent?.projects && stats.recent.projects.length > 0 ? (
            <div className="recent-list">
              {stats.recent.projects.map(project => (
                <div key={project._id} className="recent-item">
                  <span className="item-title">{project.title}</span>
                  <span className={`item-status status-${project.status}`}>
                    {project.status}
                  </span>
                </div>
              ))}
            </div>
          ) : (
            <p>No projects yet</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
